import { UIToolInvocation, tool } from 'ai';
import { z } from 'zod';

export const generatePdfTool = tool({
  description: 'Return a PDF result for testing functionCall output with files',

  inputSchema: z.object({
    query: z.string().default('test pdf'),
    base64: z
      .string()
      .default(
        '',
      ),
  }),
  async execute({ query, base64 }) {
    return {
      queries: [query],
      results: [
        {
          id: 'pdf_1',
          title: 'Test PDF',
          snippet: 'A minimal embedded PDF for e2e testing',
        },
      ],
      pdf: {
        mediaType: 'application/pdf' as const,
        base64,
      },
    };
  },
  toModelOutput: () => ({
    type: 'text',
    value: 'PDF generated.',
  }),
});

export type PDFGenerateUIToolInvocation = UIToolInvocation<
  typeof generatePdfTool
>;
